INSERT INTO `daikuan` VALUES ('4551x10x3', 'http://neijiang.haodai.com/xiaofei/4551x10x3.html', '内江隆携小额贷款有限公司', '10', '3', '34633', '0', '月管理费 1.30% 一次性收费 3.00%', '1.00～15.00 万元', '1～12 个月', '分期还款', '5', '506', '内江户口、工作单位在内江、连续工作1年以上 1、内江户口 2、工作单位在内江 3、在现单位连续工作1年以上 4、借款用途明确（合法） 5、征信良好', '1、身份证明（身份证、户口本、婚姻证明） 2、工作及收入证明：工作证、劳动合同、社保卡、单位盖章的工作收入证明、近1年银行流水 3、财产及负债证明（房产证或购房合同、车辆行驶证和发票、其他财产权利证明、银行或其他民间借款证明） 4、居住证明（现居住地最近1个月的水、电、气、物管费发票）', '“个人消费贷款”是指银行或其他金融机构向个人客户发放的有指定消费用途的人民币贷款业务，用途主要有个人住房、汽车、一般助学贷款等消费性个人贷款', 'http://neijiang.haodai.com/Public/upload/bank/3411.gif', '信用贷', 'hdstars Sval_20', '内江户口;工作单位在内江;连续工作1年以上', '放贷额度高;放贷速度快', 'http://neijiang.haodai.com/Public/upload/xindai/tag/11.png;http://neijiang.haodai.com/Public/upload/xindai/tag/12.png;');
INSERT INTO `daikuan` VALUES ('5464x5x18', 'http://kunming.haodai.com/xiaofei/5464x5x18.html', '昆明友众信业商务顾问有限公司', '5', '18', '3968', '2', '月管理费 2.38%', '3.00～20.00 万元', '12～36 个月', '分期还款', '3', '2409', '上班3个月以上、月收入2000以上、个人信用良好', '1、身份证 2、工作证明（工牌、劳动合同、公司开具的工作收入证明） 3、工资卡、个人储蓄卡近3个月银行流水 4、现住址近60天内水或电费发票任意一张 5、信用报告', '最轻松的贷款渠道。申请人只需年满21周岁、提供身份证明、收入证明、工作证明、居住合同收据等，即可申请不超过其月收入10倍的个人消费贷款', 'http://kunming.haodai.com/Public/upload/bank/4538.gif', '信用贷', 'hdstars Sval_10', '上班3个月以上;月收入2000以上;个人信用良好', '手续简便', 'http://kunming.haodai.com/Public/upload/xindai/tag/25.png;');
