INSERT INTO `daikuan` VALUES ('8144x20x24', 'http://weifang.haodai.com/xiaofei/8144x20x24.html', '汇中财富潍坊分公司', '20', '24', '12033', '9', '月管理费 1.85%', '1.00～50.00 万元', '6～36 个月', '分期还款', '5', '1111', '22-60周岁、月流水1500以上、无不良信用记录 1、年龄条件：22-60周岁 2、流水条件：1500以上 3、信用条件：无不良记录即可 4、房产条件：最好本人名下有房 5、其他重要条件（户口、工作类别等）本地上班和做生意的都可以', '1、身份证', '费率低、3-5天放款、无抵押、无担保、手续简单、信用可空白、用途多样、无需房产', 'http://weifang.haodai.com/Public/upload/bank/7978.gif', '信用贷', 'hdstars Sval_25', '22-60周岁;月流水1500以上;无不良信用记录', '放贷额度高;放贷速度快;利率较低', 'http://weifang.haodai.com/Public/upload/xindai/tag/11.png;http://weifang.haodai.com/Public/upload/xindai/tag/12.png;http://weifang.haodai.com/Public/upload/xindai/tag/19.png;');
