-- ----------------------------
-- Table structure for `daikuan`
-- ----------------------------
DROP TABLE IF EXISTS `daikuan`;
CREATE TABLE `daikuan` (
  `cid` varchar(50) NOT NULL,
  `url` varchar(100) NOT NULL,
  `company_name` varchar(100) NOT NULL,
  `money` int(15) NOT NULL,
  `limit_time` int(15) NOT NULL,
  `month_supply` int(15) NOT NULL,
  `total_post` int(15) NOT NULL,
  `expense_description` varchar(100) NOT NULL,
  `limit_range` varchar(100) NOT NULL,
  `term_range` varchar(100) NOT NULL,
  `Repayment` varchar(100) NOT NULL,
  `loan_time` int(15) NOT NULL,
  `applicant` varchar(20) DEFAULT NULL,
  `application_condition` longtext,
  `material` longtext,
  `detailed_description` longtext,
  `company_img` varchar(100) DEFAULT NULL,
  `load_method` varchar(100) DEFAULT NULL,
  `evaluation` varchar(100) DEFAULT NULL,
  `lender_requirements` varchar(100) DEFAULT NULL,
  `features` varchar(100) DEFAULT NULL,
  `features_img` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

